import React, {Component} from 'react';
import Logo from './Logo'
import Target from './Target'
import './Header.css'


class Header extends Component{
    render() {
        return(
            <div id="header">
                <div class="page-container clearfix" id="nav">
                    <Logo />
                    <Target />
                </div>
            </div>
        );
    }
}
export default Header
